    private static int migratoryBirds(List<Integer> arr) {
        Map<Integer, Integer> map = new HashMap<>();
        int key = 0;
        int value = 0;
        for (int i : arr) {
            int val = map.getOrDefault(i, 0);
            map.put(i, val + 1);
        }

        for (Map.Entry<Integer, Integer> i : map.entrySet()) {
            if (i.getValue() > value) {
                key = i.getKey();
                value = i.getValue();
            }
        }

        return key;
    }

